import React from "react";
import { Link } from "react-scroll";
import logo from "../assets/img/logo.png";
import {
  AiOutlineHolder,
  AiOutlineQrcode,
  AiTwotoneAlert,
} from "react-icons/ai";

export default function Header() {
  return (
    <div className="header-container max-w-[1200px] mx-auto p-3 bg-[#fdffff4d] sticky top-0 flex justify-between duration-300 shadow-2xl rounded-br-3xl rounded-bl-3xl">
      <a href="/">
        <div className="logo border-[#61dafb] border-2 rounded-lg">
          <img src={logo} className="h-[50px]" alt="Logo" />
        </div>
      </a>

      <ul className="flex text-[#61dafb] justify-center items-center flex-row gap-5 text-[20px]">
        <li>
          <Link to="main" spy={true} smooth={true} offset={-70} duration={500}>
            Home
          </Link>
        </li>
        <li>
          <Link to="main" spy={true} smooth={true} offset={-70} duration={500}>
            About Me
          </Link>
        </li>
        <li>
          <Link
            to="experience"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Experience
          </Link>
        </li>
        <li>
          <Link to="home" spy={true} smooth={true} offset={-70} duration={500}>
            Home
          </Link>
        </li>
      </ul>
    </div>
  );
}
